import ContentHeader from "../../Constants/ContentHeader/ContentHeader";
import Sidebar from "../../Constants/Siderbar/Sidebar";
import FormOutStock from "./Form/FormOutStock";

export default function ContentOutStock() 
{

    return (
        <div class="page-content d-flex align-items-stretch">
            <Sidebar/>
            <div class="content-inner">
                <div class="container-fluid">
                    <ContentHeader title="Sortie de stock"/>               
                    <div class="row flex-row">
                        <div class="col-12">
                            <FormOutStock/>
                        </div>
                    </div>
                </div>
                {/* <!-- End Container --> */}
                {/* <!-- Begin Page Footer--> */}
                <footer class="main-footer">
                    <div class="row">
                        <div class="col-xl-6 col-lg-6 col-md-6 col-sm-12 d-flex align-items-center justify-content-xl-start justify-content-lg-start justify-content-md-start justify-content-center">
                            <p class="text-gradient-02">Design By Saerox</p>
                        </div>
                        <div class="col-xl-6 col-lg-6 col-md-6 col-sm-12 d-flex align-items-center justify-content-xl-end justify-content-lg-end justify-content-md-end justify-content-center">
                            <ul class="nav">
                                <li class="nav-item">
                                    <a class="nav-link" href="documentation.html">Documentation</a>
                                </li>
                                <li class="nav-item">
                                    <a class="nav-link" href="changelog.html">Changelog</a>
                                </li>
                            </ul>
                        </div>
                    </div>
                </footer>
                {/* <!-- End Page Footer --> */}
                <a href="#" class="go-top" style="display: none;"><i class="la la-arrow-up"></i></a>
                {/* <!-- Offcanvas Sidebar --> */}

            </div>
        </div>
    );
}
